        private static IEnumerable<Region> GetRegions()
        {
            foreach (Region region in HASectors)
            {
                yield return region;
            }

            for (int l = 0; l < 3; l++)
            {
                for (int r = 0; r < 36 - 4 * l * l; r++)
                {
                    for (int q = 0; q < 4; q++)
                    {
                        for (int p = -r; p <= r; p++)
                        {
                            for (int s = 0; s < 2; s++)
                            {
                                int x = 0;
                                int z = 0;

                                switch (q)
                                {
                                    case 0: x = r; z = ~p; break;
                                    case 1: x = ~p; z = ~r; break;
                                    case 2: x = ~r; z = p; break;
                                    case 3: x = p; z = r; break;
                                }

                                int y = l ^ (-(s ^ (p & 1) ^ (r & 1) ^ (q & 1)));
                                string name = PGSectors.GetSectorName(new PGSectors.ByteXYZ { X = (sbyte)(x + 39), Y = (sbyte)(y + 32), Z = (sbyte)(z + 39) });
                                yield return new Models.Region
                                {
                                    Name = name,
                                    X0 = (x + 39) * 40960,
                                    Y0 = (y + 32) * 40960,
                                    Z0 = (z + 39) * 40960,
                                    SizeX = 40960,
                                    SizeY = 40960,
                                    SizeZ = 40960
                                };
                            }
                        }
                    }
                }
            }
        }

